        </Nav>
        <Nav>
          <Nav.Link onClick={onClick} href="/my">아니오</Nav.Link>
          <Nav.Link onClick={onClick} href="/login/form">로그인</Nav.Link>
        </Nav>
      </Container>
    </Navbar>

  )
}

export default withRouter(HeaderPage)
